payload = {
    "data": drawio_data,
}


async def test_drawio_processor():
    nc = await nats.connect(NATS_URL)
    reply = await nc.request("drawio.process", json.dumps(payload).encode(), timeout=5)
    result = json.loads(reply.data.decode())
    if isinstance(result, dict):
        if png_base64 := result.get("result").encode():
            print(f"PNG data: len = {len(png_base64)}, {png_base64[:20]}")
            png = b64decode(png_base64)
            with NamedTemporaryFile(suffix=".png", delete=False) as f:
                f.write(png)
                im = Image.open(f.name)
                im.show()
        else:
            pprint(result)
    else:
        print(result)

if __name__ == "__main__":
    asyncio.run(test_drawio_processor())
